import React, { Component ,Fragment} from 'react';
// import list from "./data/datalist.js";

class HomePage extends Component{
    constructor(props){
        super(props);
        this.state={
            inputValue:"",
            list:[3,5,1]
          }
    }
    render(){
        return(
            <Fragment>
                <div>
                    主页面
                </div>
                <ul>
                    {this.state.list.map((item,index)=>{
                        return <li key={index}>{item}</li>
                    })}
                </ul>
            </Fragment>
        )
    }
}

export default HomePage;
